import React from 'react'

const UserProfile = ({ fullName, email, city, _id }) => {
    return (
        <ul>
            <li>Name: {fullName}asd</li>
            <li>Email: {email}</li>
            <li>City: {city}</li>
            <li>ID: {_id}</li>
        </ul>
    )
}

export default UserProfile
